import React from "react";
import "./Train_part.css";



function Train_part() {
    return (
        <>
            <div className="Outer_Div">
                <div className="Inner_Div">
                    <div>
                        <video loop height="600px" width="500px" autoplay muted class="v2">
                            
                        </video>


                    </div>
                </div>
            </div>
        </>
    );

}
export default Train_part;
